def findSubstring_WA(s, words):

    def find(w, li):
        for idx, l in enumerate(li):
            if l == w:
                return idx
        return -1

    n_word = len(words)
    len_word = len(words[0])
    results = []
    for idx in range(0, len(s)):
        target_word = s[idx: idx + len_word]
        if target_word in words:
            used = [False] * n_word
            for sub_idx in range(0, n_word):
                next_word = s[idx + sub_idx * len_word: idx + (sub_idx + 1) * len_word]
                # print(next_word)
                next_word_idx = find(next_word, words)
                if next_word_idx != -1 and not used[next_word_idx]:
                    used[next_word_idx] = True
                else:
                    break
            if sum(used) == n_word:
                results.append(idx)
            idx += len_word
            # print('---')

    return results


def findSubstring_TLE(s, words):

    def dfs(sub_s, re_words):
        # print(sub_s, re_words)
        if len(re_words) == 0:
            return True
        next_word = sub_s[0: len_word]
        for sub_idx, word in enumerate(re_words):
            if next_word == word:
                re_words.pop(sub_idx)
                if dfs(sub_s[len_word: ], re_words):
                    return True
                else:
                    return False
        return False

    # n_word = len(words)
    len_word = len(words[0])
    results = []
    for idx in range(0, len(s)):
        target_word = s[idx: idx + len_word]
        if target_word in words and dfs(s[idx: ], words.copy()):
            results.append(idx)
            idx += len_word
            # print(results)

    return results


def findSubstring(s, words):
    results = []
    words_hash_map = {}
    for w in words:
        if w in words_hash_map:
            words_hash_map[w] += 1
        else:
            words_hash_map[w] = 0

    n_word = len(words)
    len_word = len(words[0])
    results = []
    for idx in range(0, len(s)):
        target_word = s[idx: idx + len_word]
        if target_word in words:
            target_hash_map = {}
            flag = True
            for sub_idx in range(0, n_word):
                next_word = s[idx + sub_idx * len_word: idx + (sub_idx + 1) * len_word]
                if next_word not in words_hash_map:
                    flag = False
                    break
                else:
                    if next_word in target_hash_map:
                        target_hash_map[next_word] += 1
                    else:
                        target_hash_map[next_word] = 0

                    if target_hash_map[next_word] > words_hash_map[next_word]:
                        flag = False
                        break
                    else:
                        pass
            if flag:
                results.append(idx)
            else:
                pass
            idx += len_word

    return results


